const app = getApp();
Page({
  data: {
    groups: [],
    StatusBar: app.globalData.StatusBar,
    CustomBar: app.globalData.CustomBar,
    hidden: true,
    notice_jpg: "data:image/jpeg;base64,"
  },

  gotoNotice: function (options) {
    console.log(options.currentTarget.dataset)
    console.log(options.currentTarget.dataset.groupid)
    console.log(options.currentTarget.dataset.groupname)
    let notices = []
    //wx.request
    wx.request({
      url: "https://www.ningziqian.work:8000/noticeinfo/",
      method: "POST",
      data: {
        groupID: options.currentTarget.dataset.groupid
      },
      // 服务器返回信息，将信息存储至本地缓存
      success: function (res) {
        app.globalData.notices = res['data']
        console.log(res)
        wx.navigateTo({
          url: '/pages/group/notice/notice?groupname=' + JSON.stringify(options.currentTarget.dataset.groupname)
        })
      },
      fail: function (res) {
        console.log('submit fail');
      },
    })

  },



  gotoNoticeSend: function () {
    wx.navigateTo({
      url: '/pages/group/notice_send/notice_send',
    })
  },

  gotoAddGroup: function (options) {
    wx.request({
      url: "https://www.ningziqian.work:8000/get_all_group/",
      method: "GET",
      success: function (res) {
        console.log(res)
        app.globalData.allGroups = res['data']
          wx.navigateTo({
            url: '/pages/group/add_group/add_group?'
          })
      },
      fail: function (res) {
        console.log('submit fail');
      },
    })
    
  },

  onLoad() {
    console.log(app.globalData)
    if (app.globalData.userinfo['type'] === "admin") {
      this.setData({
        userType: 1,
      })
    } else {
      this.setData({
        userType: 0,
      })
    }
    this.setData({
      groups: app.globalData.groups,
    })
  },
  onShow() {
    this.setData({
      groups: app.globalData.groups,
    })
  },
});